JOIN `mapel` ON `mapel`.`id_mapel` = `m_ujian`.`mapel_id`
JOIN `guru` `g1` ON `g1`.`id_guru` = `m_ujian`.`guru_id`
LEFT JOIN `jenjang` ON `jenjang`.`id_jenjang` = `m_ujian`.`id_jenjang_target`
